import React from 'react';

function List() {
  const people = [
    {
      name: 'Sonny'
    },
    {
      name: 'Fiko'
    },
    {
      name: 'Vinsen'
    }
  ]
  return(
    <ul>
      {people.map(person => (
        <li key={person.name}>{person.name}</li>
      ))}
    </ul>
  );
}

function App() {
  return (
    <div className="App">
      <h1>React People</h1>
      <List/>
    </div>
  );
}

export default App;
